package com.highlion.entity;

public class Dog {
	private int id;
	private String name;
public Dog() {
	// TODO Auto-generated constructor stub
}
public Dog(int id, String name) {
	super();
	this.id = id;
	this.name = name;
}
public int getId() {
	return id;
}
public void setId(int id) {
	this.id = id;
}
public String getName() {
	return name;
}
public void setName(String name) {
	this.name = name;
}


}
